import React from 'react';

export const CreateAccountcomponent = ({ 
    firstName,
    setFirstName,
    lastName,
    setLastName,
    firstNamePlaceholder,
    lastNamePlaceholder,
    handleFirstNameClick,
    handleLastNameClick,
    handleFirstNameBlur,
    handleLastNameBlur,
    handleNextClick,
    firstNameEmpty
}) => {

    return (
        <form>

            <h1 class="thin h1-space">Create a Google Account</h1>

            <h2 class='thin gap'>Enter your name</h2>

            <label class="space line-height label-input-width input-label">
                <input 
                    id='firstNameInput'
                    class={`${firstNameEmpty ? 'error' : "input"}`}
                    type='text' 
                    value={firstName} 
                    onChange={(e) => setFirstName(e.target.value)} 
                    placeholder={firstNamePlaceholder}
                    onFocus={handleFirstNameClick}
                    onBlur={handleFirstNameBlur}
                />
            </label>
     
            <label class="space line-height label-input-width input-label">
                <input 
                    class="input disable-eye-icon"
                    type='text'
                    value={lastName}
                    onChange={(e) => setLastName(e.target.value)}
                    placeholder={lastNamePlaceholder}
                    onFocus={handleLastNameClick}
                    onBlur={handleLastNameBlur}
                />
            </label>

            {firstNameEmpty && 
                <div class='error-div'>
                    <p class="input-error-message">Enter a password</p>
                </div>
            }
            
            <div class='button-right'>
                <button class="button-space blue-button" onClick={handleNextClick}>
                    Next   
                </button>
            </div>

        </form>
    );
}
